"    Spread out Bragg peak",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 452px; height: 418px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A characteristic spread-out Bragg peak (SOBP) depth-dose distribution along the beam central axis, together with the depth-dose distributions of the contributing pristine Bragg peaks. The SOBP is specified in terms of its range, measured at the distal 90 percent dose position and which is approximately 1 mm less than the range (160 mm here) of the most distal pristine Bragg peak, and its modulation width (100 mm here and indicated by the horizontal dash-dot line) specified as the width between the distal and proximal 90 percent dose values (indicated by the vertical dash-dot lines). The depth-dose distribution is characterized by an entrance dose region that rises from a nonzero entrance dose to the near uniform 100 percent region (bounded by the &plusmn;2 percent dashed lines) which extends up to the range of the most distal pristine Bragg peak. The composite pristine Bragg peaks (13 in this example) have specific relative intensities such that, in summation, they yield the observed uniform 100 percent dose region.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Kooy HM, Trofimov A, Engelsman M, Smith AR. Principles of Systems and Optimization. In: Proton and Charged Particle Radiotherapy, DeLaney TF, Kooy HM (eds.). Philadelphia: Lippincott Williams &amp; Wilkins, 2008. Copyright &copy; 2008 Lippincott Williams &amp; Wilkins.",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.lww.com\">",
"      file://www.lww.com",
"     </a>",
"    </div>",
